import React from "react";

export default function Contacts() {
  return (
    <section className="text-lg leading-relaxed text-gray-300 space-y-4">
      <p>
        Email:{" "}
        <a
          href="mailto:contact@hankimstudio.com"
          className="text-yellow-400 hover:underline"
        >
          contact@hankimstudio.com
        </a>
      </p>
      <p>
        Instagram:{" "}
        <a
          href="https://instagram.com/hankimstudio"
          target="_blank"
          rel="noopener noreferrer"
          className="text-yellow-400 hover:underline"
        >
          @hankimstudio
        </a>
      </p>
    </section>
  );
}
